import React, { Component } from 'react'

class Login extends Component{

  state = {
    email: '',
    password: ''
  }


  render(){
    return (
      <div>
        <form>
          <input type="text" placeholder="Email" /><br/>
          <input type="password" placeholder="Password" />
          <input type="submit" value="Login" />
        </form>
      </div>
    )
  }
}

export default Login
